import './App.css'
import Navbar from './components/Navbar'
import Home from './components/Home'
import Login from './components/Login'
import Register  from './components/Register'

function App() {
  return (
    <>
    <Navbar />
    <div className='Space'></div>
    <div className="App">
      <h1>Hello World</h1>
      <Home />

      <Login />
      <Register />
    </div>
    </>
  );
}

export default App;
